import Expense from "./components/Expense";

function App() {
  const expenses = [
    // sara khel ese ka hai yeh hi niche access hoga dynamicaly expenseitem component mae
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },

    {
      id: "e2",
      title: "Car Insurance",
      amount: 1234.45,
      date: new Date(2020, 12, 15),
    },

    {
      id: "e3",
      title: "Books",
      amount: 123.45,
      date: new Date(2020, 9, 18),
    },
  ];
  return (
    <div>
     <Expense>{item=expenses}</Expense>      
    </div>
    //  feature by which we can injected html in javascript is called the JSX.
  );
}

export default App;
